INSERT INTO `object_import` VALUES (7,2,NULL,NULL,77,8545,NULL,'Кирова','2',NULL,3,13,22,32,12,NULL,7500,'Сергей','+7 (960) 189 30 92','','<p>Сдам на длительный срок студию, необходимо приобрести холодильник и диван в счёт арендной платы (далее остаются в квартире). Есть шкаф для одежды, тумба для ТВ, стиральная машина, микроволновая печь, прихожая для одежды, пластиковое окно. Сдам девушке или паре (без животных и детей). Цена без коммунальных платежей без торга. В квартире очень тепло.</p>',NULL,41,NULL,'[\"\\/uploads\\/715grey.png\"]',1,1574420768,1574421149),(8,2,NULL,NULL,77,8541,NULL,'Кирова','3а',NULL,3,9,32,NULL,NULL,NULL,7000,'Сергей','+7 (920) 000 00 00','','<p><description>ТВ, стиральная машина, микроволновая печь, прихожая для одежды, пластиковое окно. Сдам девушке или паре (без животных и детей). Цена без коммунальных платежей без торга. В квартире очень тепло.</description>  </p>',NULL,41,NULL,'[\"\\/uploads\\/rolikovaya-3.png\",\"\\/uploads\\/rolikovaya-2.png\",\"\\/uploads\\/rolikovaya.png\",\"\\/uploads\\/petlya716_1510318254.jpg\",\"\\/uploads\\/716.png\",\"\\/uploads\\/715grey.png\",\"\\/uploads\\/715bronza-2.png\",\"\\/uploads\\/715bronza.png\",\"\\/uploads\\/FL65SSN_1.png\",\"\\/uploads\\/FL65SSN.png\",\"\\/uploads\\/FL65SSN_1510306094.jpg\"]',1,1574425117,1574425303),(9,1,NULL,NULL,11,1210,NULL,'Кирова','3',NULL,3,12,NULL,NULL,NULL,NULL,9000,'3','+7 (980) 000 00 00','','<p>апыап</p>',NULL,41,NULL,'[\"\\/uploads\\/963bb6919feb862551a0d3b4b640227e.jpg\",\"\\/uploads\\/214567440.jpg\",\"\\/uploads\\/i.jpeg\",\"\\/uploads\\/XXL.jpeg\",\"\\/uploads\\/1007313_w936h624.jpg\",\"\\/uploads\\/1266637430147655_92a5.jpg\",\"\\/uploads\\/sdam-1k-kv--m--xolodnaya-gora-photo-9bc1.jpg\"]',1,1574425491,1574425491);
