22cfa6c08dc2696b93cfa958256_1200_800_p.jpg ,/images/objects/104/e0690e68d5625fffe598d7747d644884_1200_800_p.jpg ,/images/objects/104/cd268c6b1e9306a3cfea06ee7eee61da_1200_800_p.jpg ,/images/objects/104/c8eec153e4845f9171d5f683100e8ced_1200_800_p.jpg ,/images/objects/104/37d9f216145b45fe49cfe9f517fff882_1200_800_p.jpg ,/images/objects/104/41bfeccae384f5fa3c9cb035eb09451d_1200_800_p.jpg  ,/images/objects/104/4d1f9ac78805dd88e9e9824b0c32370e_1200_800_p.jpg ,/images/objects/104/0d14dce5a6edf3013465b682a1aeebc3_1200_800_p.jpg ,/images/objects/104/5d18c05327a9ab486076c512.jpg   ,/images/objects/104/5d2b992c821a9969f739fd3a.jpg ,/images/objects/104/aaeb8d04e2749cdcab18748a3f1b6e57_1200_800_p.jpg ,/images/objects/104/a2e81b7d07eace1b2898f7008b22a765_1200_800_p.jpg ,/images/objects/104/14e3fc75969d8869437a89df71f70c41_1200_800_p.jpg ,/images/objects/104/92798db55ffbfa50137e84b7c55fc8cc_1200_800_p.jpg ,/images/objects/104/59c9c3f7c64b5254bbd022719e602281_1200_800_p.jpg ,/images/objects/104/d116868c061f9b8e2ca1e882f6681e0f_1200_800_p.jpg ,/images/objects/104/115bc9e5e57f336d8aa6b638a239d0df_1200_800_p.jpg ',22,1573755501,NULL,1573755501,1574425841,NULL,NULL,NULL,NULL,NULL,NULL),(105,1,1,4,0,0,0,NULL,NULL,1612,17288,NULL,'','','Ленинградская область, Всеволожский район, Рахьинское городское поселение, садоводческое некоммерческое товарищество Лепсари, 28','','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,450000,NULL,'Филипп Игоревич','9219425608','','',NULL,0,NULL,0,'',0,'',0,NULL,NULL,'<p>СНТ (ДНП) \"Лепсари\" - 30 км от города, Дорога Жизни, через Всеволожск, и деревню Проба</p><p>- незагруженное шоссе</p><p>- развитое садоводство</p><p>- круглогодичный подъезд, асфальт</p><p>- детская площадка, пожарный водоем, пляж</p><p>- огороженная территория, охрана, шлагбаум, освещение</p><p>- зелень, рядом речки/рыбалка, лес/охотничьи угодья</p><p>- много готовых домов, постоянно проживающих соседей</p><p>Ровный прямоугольный, зеленый участок. 10 соток. </p><p>Электричество - Подключено к маленькой бытовке. </p><p>Въезд на участок отсыпан, через канаву проложена труба. </p><p>Дренаж. </p><p>Все готово для начала строительства. </p><p>Посредников просьба не беспокоить - в помощи по продаже не нуждаюсь.</p><p>Есть еще двойной участок в том же садоводстве - 20 сот.</p>','',NULL,NULL,1,0,0,NULL,'/images/objects/105/4856099812.jpg ,/images/objects/105/3400040596.jpg ,/images/objects/105/4856099786.jpg ,/images/objects/105/4856099816.jpg ,/images/objects/105/4856099812.jpg ,/images/objects/105/5478764595.jpg ,/images/objects/105/5478764596.jpg ,/images/objects/105/cad478ef573fd85b31e667737e65c5a4_1200_800_p.jpg ,/images/objects/105/579d9963367aeb9c47e84146e4ebaf91_1200_800_p.jpg ,/images/objects/105/992c8215a094019579f65db209b75488_1200_800_p.jpg ,/images/objects/105/fb3b4a10010335bc64edeea288dbf0bd_1200_800_p.jpg ,/images/objects/105/95ebdcf70da98de5824bdd90f6db458c_1200_800_p.jpg ,/images/objects/105/ebaf65f476001671ac817298b469d2b0_1200_800_p.jpg ,/images/objects/105/d1d35a7bdaa123975ecea28651230837_1200_800_p.jpg ,/images/objects/105/7ec88fda6779d075c940bfe04c23939b_1200_800_p.jpg   ,/images/objects/105/e6d582b59b19db8dc78872e27ac58ed1_1200_800_p.jpg ,/images/objects/105/bdcd12524ffbedfc71d0c483a699cc58_1200_800_p.jpg ,/images/objects/105/10b9b6d2a0195358365222e609f38652_1200_800_p.jpg ,/images/objects/105/d69d43d833a8423900ab5eb47a53de28_1200_800_p.jpg  ,/images/objects/105/a2e81b7d07eace1b2898f7008b22a765_1200_800_p.jpg ,/images/objects/105/14e3fc75969d8869437a89df71f70c41_1200_800_p.jpg ,/images/objects/105/59c9c3f7c64b5254bbd022719e602281_1200_800_p.jpg ,/images/objects/105/d116868c061f9b8e2ca1e882f6681e0f_1200_800_p.jpg ,/images/objects/105/115bc9e5e57f336d8aa6b638a239d0df_1200_800_p.jpg ,/images/objects/105/4066c879fb13eadfd6115959a5dc5a2d_1200_800_p.jpg ,/images/objects/105/b56e3f557c6181df5644f404e670d035_1200_800_p.jpg ,/images/objects/105/f97acd240186feddf86a2dc9aa721304_1200_800_p.jpg ,/images/objects/105/eef173f0fd2a1599c9b8afe734c0db